import React, { Component } from "react";
import ContactForm from "../components/ContactForm";
export default class Footer extends Component {
  render() {
    return (
      <div style={{ backgroundColor: "black" }}>
        <div
          className="jumbotron"
          style={{ backgroundColor: "#1a1a1a !important" }}
        >
          <h1>Contact us!</h1>
          <br></br>
          <ContactForm />
        </div>
      </div>
    );
  }
}
